eventos.Description:
Na sala 06 havia uma aplicadora cochilando;
Haviam Fiscais volantes e de Banheiro conversando entre si no pátio.
Um dos aplicadores estava efetuando a leitura do caderno de questões nas salas 07 e 08.

Na Coordenação de n° 7221, foram verificadas as seguintes condutas:
1 - Aplicadora da Sala 3 cochilando;
2- Aplicador da Sala 5 cochilando;
3  - Fiscais de banheiro no segundo andar conversando com recorrência;
4 - Aplicador dormindo na Sala 9, com recorrência;
5 - Aplicador dormindo na Sala 12, com recorrência. 

Os nomes não foram apresentados porque a observação aconteceu por meio de um compartilhamento de vidro na porta, o que inviabilizava a identificação pelo crachá.

Na Coordenação n° 7221, foram observadas as seguintes condutas irregulares: 
1. Aplicadora cochilando na Sala 3;
2. Aplicador cochilando na Sala 5;
3. Aplicador dormindo na Sala 9;
4. Aplicador dormindo na Sala 12;
5. Fiscais de banheiro no segundo andar conversavam com recorrência. 

Observações:
1. Devido à abertura de vidro nas portas ser pequena, não foi possível identificar os integrantes  pela distância de observação; 
2. Esta ocorrência foi registrada 3 vezes. Devido à instabilidade no sistema, as in
formações sobre o registro ou não demanda não pôde ser visualizado.
